import{_ as r,c as n,o as a,ae as i}from"./chunks/framework.AELpvxz7.js";const c=JSON.parse('{"title":"Einführung","description":"Einführung für das Projekt","frontmatter":{"title":"Einführung","description":"Einführung für das Projekt"},"headers":[],"relativePath":"pages/general.md","filePath":"pages/general.md"}'),t={name:"pages/general.md"};function s(d,e,l,u,o,f){return a(),n("div",null,e[0]||(e[0]=[i('<h1 id="einfuhrung" tabindex="-1">Einführung <a class="header-anchor" href="#einfuhrung" aria-label="Permalink to &quot;Einführung&quot;">​</a></h1><p>Willkommen auf Roleplay.net! Wir bieten einen Minecraft und einen FiveM Server an, die ihren Fokus auf Roleplay legen. Hier findest du alle Informationen die du brauchst, um auf den Servern spielen zu können.</p><p>Wir empfehlen dir, dem <a href="https://discord.gg/JRQdV5BPjY" target="_blank" rel="noreferrer">Discord Server</a> beizutreten, da du so mit anderen Spielern in Kontakt treten kannst und den ganzen Server erleben kannst.</p><h2 id="der-minecraft-server" tabindex="-1">Der Minecraft Server <a class="header-anchor" href="#der-minecraft-server" aria-label="Permalink to &quot;Der Minecraft Server&quot;">​</a></h2><p>Auf unserem Minecraft Server, der im Jahr 1869 spielt, werden die Möglichkeiten der industriellen Revolution voll ausgenutzt! Der Server läuft auf der Minecraft Java Version 1.20.1 mit Arclight, einem Spigot-Forge-Hybrid. So können wir für das beste Erlebnis sowohl einige Mods als auch Plugins laufen lassen.</p><p>Durch Mods wie Create kannst du Maschinen bauen, die verschiedenste Aufgaben komplett automatisieren können. Farmer&#39;s Delight fügt neue Nahrungsmittel hinzu und Automobility gibt uns die ersten Autos! Um das Erlebnis noch realistischer zu gestalten, benutzen wir Lightman&#39;s Currency für ein Wirtschaftssystem und Simple Voice Chat, um mit anderen Spielern auf dem Server reden zu können.</p><p>Mehr Informationen findest du <a href="/pages/minecraft.html">hier</a>.</p><h2 id="der-fivem-server" tabindex="-1">Der FiveM Server <a class="header-anchor" href="#der-fivem-server" aria-label="Permalink to &quot;Der FiveM Server&quot;">​</a></h2><p>[TK]</p>',9)]))}const m=r(t,[["render",s]]);export{c as __pageData,m as default};
